import React, { Component } from 'react';
import ImgProfile from '../Image/sinh1.jpg'
import {HashLink as Link} from 'react-router-hash-link'
class Profile extends Component {
    render() {
        return (
            <div>
                <div className = 'card'>
                    <div className = 'card-image'>
                        <img className = 'activator' src = {ImgProfile} alt = "Trần Văn Sinh"/>
                     </div>
                     <div className = "card-content">
                         <span className = "card-title activator grey-text text-darken-4"><h4>Võ Thanh Sơn</h4></span>
                         <h5>Sinh viên , 21 tuổi</h5>
                     </div>
                </div>
            </div>
        );
    }
}

export default Profile;
